import React from 'react'

export const Bucket = () => {

    const bucket_data = [
        {img: "/metall.jpg"},
        {img:"/paper.jpg"},
        {img:"/plactic.jpg"}
    ];

    return (
        <div>
            <img src={bucket_data[0].img} ></img>
            <img src={bucket_data[1].img} ></img>
            <img src={bucket_data[2].img} ></img>
        </div>
    )
}
